import React, { Fragment } from 'react';
import { Link, Route } from 'react-router-dom';
import SignUp from '../SignUp/SignUp';
import './header.css'

function Header(props) {
    return (
        <Fragment>
            <Route>
                <SignUp />
            </Route>
            <header>
                <div class='headerContainer'>
                    <h2>toMasterDev</h2>
                    <div class='headerButtonsContainer'>
                        <button className='headerButton' id='browseButton' hidden>Browse</button>
                        <button className='headerButton' id='signInButton'>Sign In</button>
                        <Link to='signup'><button className='headerButton' id='signUpButton'>Sign Up</button></Link>
                    </div>
                </div>

            </header>
        </Fragment>
    );
}

export default Header;
